        category: randomizedCategory, // Use randomized category here
        adults: roomDetail.adults || 0,
        children:
          childrenCount > 0
            ? (roomDetail.childrenAges || []).slice(0, childrenCount) // Ensure only valid number of children ages are passed
            : [],
